public class BoxTest{	public static void main(String[] args){		Box b1 = new Box (10,9,8);		Box b2 = new Box (10,9,8);		if (b1.equals(b2)) {			System.out.println("b1 == b2");			System.out.println("b1 is " + b1.toString());			System.out.println("b2 is " + b2.toString());		}		else {			System.out.println("b1 != b2");		}	}}